  solutionPlainText:
    "<p>Texas, 1980. Alors qu'il chasse près de la frontière du Mexique, Llewelyn Moss (Josh Brolin) découvre par hasard les cadavres d'une bande de trafiquants de drogue et une mallette contenant deux millions de dollars, dont il s'empare. Mais il se retrouve poursuivi par des complices des trafiquants mexicains et prend la fuite, tandis que sa femme Carla Jean (Kelly Macdonald) se réfugie chez sa mère à Odessa.\n</p><p>Le lendemain soir, Anton Chigurh (Javier Bardem), tueur à gages psychopathe engagé initialement pour récupérer l'argent, élimine ses employeurs (des hommes d'affaires scrupuleux en affaire avec les trafiquants mexicains dont ils comptaient les trahir en expliquant la fusillade) et se met sur la piste de Llewelyn. Au matin, le shérif Bell (Tommy Lee Jones), homme vieillissant et désabusé qui vient de perdre un de ses adjoint (tué par Chigurh deux jours plus tôt), découvre la scène du crime et se met également sur la piste de Llewelyn.\n</p><p>Ce dernier se réfugie à Del Rio dans un motel et cache la mallette dans le conduit d'aération, mais les autres trafiquants mexicains, puis Chigurh retrouvent la trace de l'argent grâce à l'émetteur caché dedans par les employeurs de ce dernier. Alors que le tueur élimine les mexicains, Llewelyn se réfugie à l'hôtel Eagle avec l'argent. Mais là-bas, il découvre l'émetteur et est manqué d'être tué par Chigurh qui a retrouvé sa trace et, gravement blessé, cache l'argent sous un pont et se réfugie de l'autre côté de la frontière.\n</p><p>Le lendemain à l'hôpital au Mexique, Llewelyn, en convalescence, reçoit la visite du mercenaire Carson Wells (Woody Harrelson), engagé pour retrouver Chigurh après la mort des hommes d'affaires dans le désert. Le soir, le mercenaire retourne de l'autre côté de la frontière et se rend à l'hôtel Eagle où avait lieu la visite de Chigurh la veille. Mais ce dernier fait une nouvelle visite pour tuer Carson Wells et fait une offre à Llewelyn par téléphone de lui rendre l'argent pour épargner sa femme.\n</p><p>Le lendemain, pendant qu'Anton part tuer son ancien employeur et commanditaire en lui reprochant d'avoir donné un récepteur aux mexicains, Llewelyn traverse à nouveau la frontière, récupère l'argent et donne rendez-vous à sa femme dans un motel à El Paso dans le but de prendre le large. Prévenu par Carla Jean, le shériff se rend également à El Paso pour retrouver Llewelyn, mais arrive trop tard, ce dernier vient d'être tué par le cartel mexicain qui l'a retrouvé et a récupéré l'argent. L'enquête se termine tragiquement et le shériff renonce à poursuivre la piste de Chigurh faute d'éléments et prend sa retraite, se sentant dépassé par les évènements.\n</p><p>Quelques temps plus tard, Carla Jean qui vient de perdre sa mère reçoit la visite de Chigurh à Odessa lui expliquant que son mari ne l'a pas payé pour la laisser en vie. Si le sort de Carla Jean est inconnu à l'issue de cette visite, Anton Chigurh est victime d'un accident de voiture peu après. Il est gravement blessé au bras, mais repart avant que les secours n'arrivent. Le film se termine par l'ancien shériff qui raconte un rêve à sa femme.\n</p><p> \n</p>",
